import React, { useState,useEffect, useRef } from 'react'
import { Range, getTrackBackground } from "react-range";





function Pace() {
    const STEP = 0.1;
    const MIN = 0.1;
    const MAX = 2.0;
    const [pace, setPace] = useState(0);

  return (
    <div>
      <label>
        <strong>Pace&nbsp;&nbsp;</strong>
       <Range 
            values = {this.state.values}
            step = {STEP}
            min = {MIN}
            max = {MAX}
            onChange={(pace) => this.setState({ pace })}


       />
        <input type="range" id="pace" min="0.1" max="2.0"></input>
        &nbsp;&nbsp;{pace}&nbsp;x
      </label>
    </div>
  );}


export default Pace
